std::string format_markdown(const std::string &text, const T &value)
{
    auto m = text.find(":");
    if (m == std::string::npos)
        return text;

    std::string result = text.substr(0, m);
    std::string markdown = text.substr(m + 1);

    return markdown + value.format(result);
}

std::string format_html(const std::string &text, const std::vector<T> &values)
{
    auto m = text.find(":");
    if (m == std::string::npos)
        return text;

    std::string result = text.substr(0, m);
    std::vector<std::string> markdown;

